import React, { Component } from 'react';
import '../App.css';
import {Link} from  'react-router-dom';
import Slider from '@material-ui/core/Slider';
import { withStyles } from '@material-ui/core/styles';
import {findUser,retrieveUsers} from '../actions/actions';
import { Button } from 'react-bootstrap';
import { compareSync } from 'bcryptjs';
const CustomSlider = withStyles({
    root: {
        color: "#6f8eff",
        height: 3,
        padding: "13px 0",
    },
    track: {
        height: 4,
        borderRadius: 2,
        color: "green",
    },
    thumb: {
        height: 20,
        width: 20,
        backgroundColor: "green",
        border: "1px solid currentColor",
        marginTop: -9,
        marginLeft: -11,
        boxShadow: "#ebebeb 0 2px 2px",
        "&:focus, &:hover, &$active": {
            boxShadow: "white 0 2px 3px 1px",
        },
        color: "green",
    },
})(Slider);
class BudgetPC extends Component {
    constructor(props){
        super(props);
        // This binding is necessary to make `this` work in the callback
      }
      componentDidMount(){
    }

    render() {
      return (
            <div className="row mt-5">
          <div className="col-lg-12 m-auto">
            <div className="card card-body">
            <h2 class="text-center mb-3" className="Label">Welcome to NDXHardware™
            </h2>
            <br></br>
            <Link className="link" to="/home"> Back to Home </Link>
            <br></br>
            <div className="form-group" id="over">
            <img src="greengamingpc.png" ></img>
            </div>
            <br></br>
            <div className="form-group">
            <h5 class="text-center mb-3" className="Label"><b>
            Please select a price value from the slider </b> 
            </h5>  
            <br></br>
            <div className="middle">
                <div className="slider-container">
                 <CustomSlider/>
                </div>
            </div>
            <br></br>
            <br></br>
            </div>
            </div>
            <h5 class="text-center mb-3" className="Label"><i class="fas fa-sign-in-alt"></i><b>
            NDXHardware™</b> 
            </h5>
            </div> 
          </div>
      );
    }
  }

  export default BudgetPC;
